  `mail_keur` int(2) DEFAULT '0' COMMENT '0 berarti belum kirim email',
  `mail_iu` int(2) DEFAULT '0' COMMENT '0 berarti belum kirim email',
  PRIMARY KEY (`id_document`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;

