  `jamsostekstartdate` datetime DEFAULT NULL,
  `pensionplanid` varchar(30) DEFAULT NULL,
  `pensionplanstartdate` datetime DEFAULT NULL,
  `lifeinsuranceno` varchar(30) DEFAULT NULL,
  `lifeinsurancestartdate` datetime DEFAULT NULL,
  `bankaccountno` varchar(30) DEFAULT NULL,
  `previousemployer` varchar(50) DEFAULT NULL,
