  `address2` varchar(100) DEFAULT NULL,
  `address3` varchar(50) DEFAULT NULL,
  `zipcode` varchar(7) DEFAULT NULL,
  `dobc` varchar(8) DEFAULT NULL,
  `datejoinc` varchar(8) DEFAULT NULL,
  `dateterminatec` varchar(8) DEFAULT NULL,
  `orgid` double DEFAULT NULL,
  `birth_place` varchar(50) DEFAULT NULL,
  `blood_type` varchar(5) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `id_position` varchar(15) DEFAULT NULL,
  `datemarried` datetime DEFAULT NULL,
  `stm` varchar(15) DEFAULT NULL,
  `koperasi` varchar(100) DEFAULT NULL,
  `housing` varchar(15) DEFAULT NULL,
  `insuranceamount` varchar(15) DEFAULT NULL,
  `debt` decimal(1,0) DEFAULT NULL,
  `bankaccountname` varchar(50) DEFAULT NULL,
  `glasslens` datetime DEFAULT NULL,
  `workinglocationtype` varchar(15) DEFAULT NULL,
